import{_ as e,o as t,c as r,O as i}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 50-73.52 Distribution of assets.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/50-73.52.md","filePath":"vacode/50-73.52.md"}'),a={name:"vacode/50-73.52.md"},s=i('<h1 id="§-50-73-52-distribution-of-assets" tabindex="-1">§ 50-73.52 Distribution of assets. <a class="header-anchor" href="#§-50-73-52-distribution-of-assets" aria-label="Permalink to &quot;§ 50-73.52 Distribution of assets.&quot;">​</a></h1><p>Upon the winding up of a limited partnership, the assets shall be distributed as follows:</p><ol><li><p>To creditors, including partners who are creditors, to the extent permitted by law, in satisfaction of liabilities of the limited partnership other than liabilities for distributions to partners under § <a href="http://law.lis.virginia.gov/vacode/50-73.36/" target="_blank" rel="noreferrer">50-73.36</a> or § <a href="http://law.lis.virginia.gov/vacode/50-73.39/" target="_blank" rel="noreferrer">50-73.39</a>;</p></li><li><p>Except as provided in the partnership agreement, to partners and former partners in satisfaction of liabilities for distributions under § <a href="http://law.lis.virginia.gov/vacode/50-73.36/" target="_blank" rel="noreferrer">50-73.36</a> or § <a href="http://law.lis.virginia.gov/vacode/50-73.39/" target="_blank" rel="noreferrer">50-73.39</a>; and</p></li><li><p>Except as provided in the partnership agreement, to partners first for the return of their contributions and secondly respecting their partnership interests, in the proportions in which the partners share in distributions.</p></li></ol><p>1985, c. 607.</p>',4),o=[s];function n(l,p,d,h,c,f){return t(),r("div",null,o)}const b=e(a,[["render",n]]);export{u as __pageData,b as default};
